import { API } from "../config";

export const getCrashes = () => {
    return fetch(`${API}/crash`, {
        method: "GET"
    })
        .then(response => {
            console.log("react get crashes")

            console.log(response.json())
            return response.json();
        })
        .catch(err => console.log(err));
};
